import React from 'react'


const itemData = [
    {
        span: "Strain",
        p: "SARS-CoV-2"
    },
    {
        span: "Symptoms",
        p: "Fever, Cough, Fatigue"
    },
    {
        span: "Usual onset",
        p: "2–14 days "
    },
    {
        span: "Nation",
        p: "VietNam"
    }

]

export default function Headtitle() {
    return (
        <div className="">
            <div className="">
                {itemData.map((itemData, index) =>
                    <div   key={index} className="flex text-5xl" >{itemData.span} <br />{itemData.p}</div>
                )}
            </div>
        </div>
    )
}
